import React, {useContext, useState} from 'react'
import { DinerContext } from '../../Contexts/DinerContext'
import TruckCard from '../Diner/TruckCard'
import Dinerheader from '../Headers/Dinerheader'
import '../../App.css'
import { OperatorBody, OperatorText } from '../../styled-components'
import TruckFavs from './TruckFavs'

export default function DinerDash() {
    const [dinerTrucks, setDinerTrucks] = useContext(DinerContext)
    console.log(dinerTrucks)

    const [favorites, setFavorites] =useState({
        name: 'Carlos Truck',
        image: 'https://rb.gy/nly5ri',
        id: Date.now() + Math.random(),

});


    return (
        <div>
        <Dinerheader/>
        <h1>Your Current Favorite Trucks:</h1>
        {map.favorites(item=>{
            return(
                <TruckFavs
                name={item.name}
                image={item.image}
                id={item.id}
                />
            )
        })}
        <h1>All Trucks:</h1>
        <div className='truckCard2'>
        {dinerTrucks.map(truck => {
            return(
                <TruckCard
                name={truck.truckName}
                key={truck.id}
                id={truck.id}
                image={truck.imgOfTruck}
                />
            )
        })}
        </div>
        </div>
    )
}
